const myImage = new Image();
myImage.src =
  "data:image/jpeg;base64,";

const myImage2 = new Image();
myImage2.src =
  "data:image/jpeg;base64,";
/////

myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas1");

  const ctx = canvas.getContext("2d");

  canvas.width = 1280;
  canvas.height = 1088;

  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  let pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  ctx.drawImage(myImage2, 0, 0, canvas.width, canvas.height);
  let pixels2 = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  let switcher = true;
  let gg = 50;
  function tf() {
    switcher = !switcher;
    gg ? 20 : 50;

    console.log(switcher);
    console.log(gg);
  }
  // let ggg = Math.sin(changeVal) * 1000;
  setInterval(tf, 15000);
  // setInterval(fireThatStuff, 6000);

  // function fireThatStuff() {
  //   ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  //   let pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  //   ctx.clearRect(0, 0, canvas.width, canvas.height);
  // }

  // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  // let pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  // ctx.clearRect(0, 0, canvas.width, canvas.height);

  // setInterval(changeImage, 5000);
  // let imageCounter = 0;
  // function changeImage() {
  //   imageCounter++;

  //   if (imageCounter > 3) {
  //     imageCounter = 0;
  //   }
  // }
  let mappedImage = [];
  let mappedImageTwo = [];
  let particleArray = [];
  const numberOfParticles = 7000;
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = "rgb(" + red + "," + green + "," + blue + ")"),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }
  // console.log(mappedImage);
  ////
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels2.data[y * 4 * pixels2.width + x * 4];
      const green = pixels2.data[y * 4 * pixels2.width + (x * 4 + 1)];
      const blue = pixels2.data[y * 4 * pixels2.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = "rgb(" + red + "," + green + "," + blue + ")"),
      ];
      row.push(cell);
    }
    mappedImageTwo.push(row);
  }
  // console.log(mappedImageTwo);
  /////
  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }
  //////////
  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 2.5;
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.angle = 0;
      this.counter = 0;
    }

    //////add noise to x wobble
    //mappedimage = cartoon girl
    // mappedimage2 = my face
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      let swap = mappedImage;
      let changeVal = 3;
      let movement = 2.5 - this.speed + this.velocity;
      if (switcher == true) {
        swap = mappedImageTwo;
        changeVal == -3;
        this.x += movement - Math.cos(changeVal) * -5;
      }
      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        this.speed = swap[this.position1][this.position2][0];
      }
      // this.speed = mappedImage[this.position1][this.position2][0];

      this.angle += this.speed / 10;
      this.y += movement + Math.cos(this.angle);
      this.x += movement + Math.tan(changeVal) * -10;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
        this.counter -= 1;
      }
      if (this.x >= canvas.width) {
        this.x = 0;
        this.y = Math.random() * canvas.height;
        this.counter += 1;
        // this.counter += 1;
      }
      //   this.x += movement;
      //   console.log(this.speed);
    }
    draw() {
      ctx.beginPath();
      // ctx.fillStyle = "red";
      if (switcher == true) {
        ctx.fillStyle = `rgb(
          ${Math.floor(this.speed * 1070)},
          ${Math.floor(this.speed)},
          ${Math.floor(this.speed * 10)})`;
      } else {
        ctx.fillStyle = `rgb(
        ${Math.floor(this.speed)},
        ${Math.floor(255 - this.speed * 100)},
        ${Math.floor(255 - this.speed)})`;
      }
      // if (
      //   mappedImage[this.position1] &&
      //   mappedImage[this.position1][this.position2]
      // ) {
      //   ctx.fillStyle = mappedImage[this.position1][this.position2][1];
      // }

      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }
  //////

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray.push(new Particle());
    }
  }
  let counter2 = 0;
  /////////
  init();
  function animate() {
    // counter2 += 1;
    // if (counter2 % 100 == 0) {
    //   ctx.globalAlpha = 0.1;
    //   ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    // }
    // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.01;
    ctx.fillStyle = "rgb(0,0,0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.4;
    for (let i = 0; i < particleArray.length; i++) {
      particleArray[i].update();
      ctx.globalAlpha = particleArray[i].speed * 0.1;
      particleArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();
});
